  return (

    <div className="App">
        <div className='Header'>
          <h1> Mountains and Rivers </h1>
        </div>
        <Router>
        <nav>
            <Link to = "/mountains">Mountains</Link>
            <Link to = "/rivers">Rivers</Link>
        </nav>

        </Router>


    </div>

  );
}

export default App;
